import React from 'react';
import './App.css';
import Header from './components/Header';
import Product from './components/Product'

function App() {
  return (
    <div className="App">
      <Header/>
      <div className="row">
            <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
              <Product/>
            </div>
        </div>

        <div class="row">
          <div class="col-xs-6 col-sm-6 col-md-6 col-lg-6">
            <Location/>
          </div>
        </div>

    </div>
  );
}

export default App;
